import React from 'react';
import { Route, Switch } from 'react-router-dom';
import './scss/App.scss';
import Footer from './components/Footer'
import Navbar from './components/Navbar'

function App() {
  return (
    <div className="App">

      <header className="App-header">
      <Navbar />
      </header>
      <Footer />

    </div>
  );
}

export default App;
